import React, { useEffect, useState } from 'react'

const Search = () => {
  const [data, setData] = useState([])
  const fetchURL = "http://api.icndb.com/"
  const getData = () =>
    fetch(`${fetchURL}jokes/random/5`)
      .then((res) => res.json())

  useEffect(() => {
    getData().then((data) => setData(data))
  }, []);


  return (
    <div>


      <table>
        {data.map((s =>
          <tr key={s.values}>{s.va}</tr>
        ))}
      </table>





    </div>

  );
}

export default Search;
